// protobuf-generated files don't compile clean. This compiles them with warnings
// disabled, without having to disable it for the entire project whole-sale.

#pragma once

#ifdef _MSC_VER
#pragma warning(push)
#pragma warning(disable : 4800 4610 4512 4510 4267 4127 4125 4100 4456)
#endif
#ifdef __GNUC__
#pragma GCC diagnostic push
#pragma GCC diagnostic ignored "-Wunused-variable"
#pragma GCC diagnostic ignored "-Wsuggest-override"
#endif

#include "onnx-ml.pb.h" // this is the actual file we include

#ifdef __GNUC__
#pragma GCC diagnostic pop
#endif
#ifdef _MSC_VER
#pragma warning(pop)
#endif
